{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/annupoonia/bellabeat-case-study-r?scriptVersionId=97504584\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","source":"# **Table of Contents**\n\n* [Introduction](#Introduction)\n* [Ask](#ask)\n    * [Guiding questions](#ask-guiding)\n    * [Key tasks](#ask-key)\n    * [Deliverable](#ask-deliverable)\n* [Prepare](#prepare)\n    * [Guiding questions](#prepare-guiding)\n    * [Key tasks ](#prepare-key)\n    * [Deliverable](#prepare-deliverable)\n    * [Dependences](#process-code-dependences)\n* [Process](#process)\n    * [Data cleaning](#process-code-data)\n    * [Manipulating the data](#process-code-manipulating)\n    * [Guiding questions](#process-guiding)\n* [Analyze](#analyze)\n    * [Guiding questions](#analyze-guiding)\n    * [Tasks performed list ](#analyze-key)\n    * [Deliverable](#analyze-deliverable)\n* [Share](#share)\n    * [Guiding questions](#share-guiding)\n    * [Key tasks](#share-key)\n    * [Deliverable](#share-deliverable)\n* [Act](#act)\n    * [Guiding questions](#act-guiding)\n    * [Key tasks](#act-key)\n    * [Deliverable](#act-deliverable)","metadata":{}},{"cell_type":"markdown","source":"<a id=\"introduction\"></a>\n# **Introduction**\n[Bellabeat](https://bellabeat.com) , a high-tech company that manufactures health-focused smart products wants to analyse the usage of one of their products in order to gain insight into how people are already using their smartdevices.Then,using this information, she would like high-level recommendations for how these trends can inform Bellabeat marketing strategy.<br/>\nThe main focus of this case is to analyze smart devices fitness data and determine how it could help unlock new growth opportunities for Bellabeat.<br/>\n**Key Stakeholders:**<br/>\n**Primary Stakeholders:**<br/>\nUrškaSršen: Bellabeat’s cofounder and Chief Creative Officer.<br/>\nSandoMur: Mathematician and Bellabeat’s cofounder; key member of the Bellabeat executive team.<br/>\n**Secondary Stakeholders:**<br/>\nBellabeat Marketing Analytics Team: A team of data analysts responsible for collecting, analyzing, and reporting data that helps guide Bellabeat’s marketing strategy.<br/>","metadata":{}},{"cell_type":"markdown","source":"<a id=\"ask\"></a>\n# **Ask**\n **<font size=\"4\">Business task</font>**<br/>\nAnalyze public data to explore smart device users daily habits and apply these insights to the Bellabeat's products to help guide marketing strategy for the company.<br/>","metadata":{}},{"cell_type":"markdown","source":"<a id=\"ask-guiding\"></a>\n### **Guiding questions**\n* **What is the problem you are trying to solve?**<br/>\nThe main objective is analyze smart devices fitness data and determine how it could help unlock new growth opportunities for Bellabeat and how could these trends help influence Bellabeat marketing strategy.<br/>\n    \n* **How can your insights drive business decisions?**<br/>\nThe insights will help the marketing team to guide marketing strategy for the company.<br/>","metadata":{}},{"cell_type":"markdown","source":"<a id=\"ask-key\"></a>\n### **Key tasks**\n* **Identify the business task:**<br/>\nGiven these facts, the business task is defined as searching for user patterns of usage of their smart devices in order to gain insights that would later better orientate marketing decisions. So, in one phrase it would be:**How do our users use our smart devices?** <br/>\n* **Consider key stakeholders:**<br/>\nThe main stakeholders here are **Urška Sršen**, Bellabeat’s co-founder and Chief Creative Officer; **Sando Mur**, Mathematician and Bellabeat’s cofounder; And the rest of the Bellabeat marketing analytics team.<br/>\n\n","metadata":{}},{"cell_type":"markdown","source":"<a id=\"ask-deliverable\"></a>\n### **Deliverable**\n\n* **A clear statement of the business task**<br/>\nTo search for user patterns of usage of their smart devices and draw conclusions.<br/>","metadata":{}},{"cell_type":"markdown","source":"<a id=\"prepare\"></a>\n# **Prepare**\nCSV files are available from [FitBit Fitness Tracker Data](https://www.kaggle.com/arashnic/fitbit) (CC0: Public Domain, dataset made available through Mobius). This Kaggle data set contains personal fitness tracker from thirty Fitbit users consented to the submission of personal tracker data.We will use R as the tool because we can explore, process and visualize datasets in one platform.<br/>","metadata":{}},{"cell_type":"markdown","source":"<a id=\"prepare-guiding\"></a>\n ## **Guiding questions**\n\n* **Where is your data located?**<br/>\nThe data is located in a kaggle dataset.\n\n* **How is the data organized?**<br/>\nThe data is organised in different files on the basis of different type of health data, each on it's own csv.\n\n* **Are there issues with bias or credibility in this data? Does your data ROCCC?**<br/>\nBias isn't a problem, the population of the dataset is it's own clients as smart devices users. And have full credibility for the same reason. And finally, it's ROCCC because it's reliable, original, comprehensive, current and cited.\n\n* **How are you addressing licensing, privacy, security, and accessibility?**<br/>\nThe company has  their own licence over the dataset. Besides that, the dataset doesn't have any personal information about the users.\n\n* **How did you verify the data’s integrity?**<br/>\nAll the files have consistent columns and each column has the correct type of data.","metadata":{}},{"cell_type":"markdown","source":" <a id=\"prepare-key\"></a>\n ### **Key task** \n-  Download data and store it appropriately.\n-  Sort and filter the data.","metadata":{}},{"cell_type":"markdown","source":"<a id=\"prepare-deliverable\"></a>\n### **Deliverable**\n* **A description of all data sources used**<br/>\n [FitBit Fitness Tracker Data](https://www.kaggle.com/arashnic/fitbit)\n* **License**: (CC0:PublicDomain)\n* This Kaggle dataset contains personal fitness tracker from thirty fitbit users. Thirty eligible Fitbit users consented to the submission of personal tracker data, including minute-level output for physical activity,heart rate,and sleep monitoring. It includes information about daily activity, steps, and heart rate that can be used to explore user's habits.","metadata":{}},{"cell_type":"markdown","source":"<a id=\"process-code-dependences\"></a>\n### **Dependences**\n#### **Installing the required packages**","metadata":{}},{"cell_type":"code","source":"install.packages(\"tidyverse\") \ninstall.packages(\"skimr\")\ninstall.packages(\"here\") \ninstall.packages(\"dplyr\")\ninstall.packages(\"ggplot2\")\ninstall.packages(\"lubridate\")\n\n\nlibrary(tidyverse)\nlibrary(skimr)\nlibrary(dplyr) \nlibrary(ggplot2)\nlibrary(lubridate)\nlibrary(gridExtra)\nlibrary(reshape2)\nlibrary(scales)\n# I hide the output to keep the size of the notebook down, please unhide if you want to see the output.","metadata":{"_kg_hide-output":true,"execution":{"iopub.status.busy":"2022-06-05T04:47:13.394916Z","iopub.execute_input":"2022-06-05T04:47:13.396536Z","iopub.status.idle":"2022-06-05T04:48:46.150722Z"},"trusted":true},"execution_count":64,"outputs":[{"name":"stderr","text":"Installing package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\nInstalling package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\nInstalling package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\nInstalling package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\nWarning message in install.packages(\"dplyr\"):\n“installation of package ‘dplyr’ had non-zero exit status”\nInstalling package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\nInstalling package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\nWarning message in install.packages(\"lubridate\"):\n“installation of package ‘lubridate’ had non-zero exit status”\n","output_type":"stream"}]},{"cell_type":"markdown","source":"### Load CSV Files\nI selected 5 data sets that provided daily activity, sleep times, and weight logs.<br/> \nRenamed the data sets to make them easier to work with during analysis.<br/> \n* **daily_activity** <- dailyActivity_merged \n* **sleep_log** <- sleepDay_merged\n* **weight_log** <- weightLogInfo_merged\n* **dailyCalories** <- dailyCalories_merged.csv\n* **dailyIntensities** <- dailyIntensities_merged.csv","metadata":{}},{"cell_type":"code","source":"# Uploading the datasets:\ndaily_activity <- read_csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/dailyActivity_merged.csv\")\nsleep_log <- read_csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/sleepDay_merged.csv\")\nweight_log <- read_csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/weightLogInfo_merged.csv\")\ndailyCalories <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/dailyCalories_merged.csv\")\ndailyIntensities <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/dailyIntensities_merged.csv\")\n# I hide the output to keep the size of the notebook down, please unhide it if you want to see the output.","metadata":{"_kg_hide-output":true,"execution":{"iopub.status.busy":"2022-06-05T04:48:48.543978Z","iopub.execute_input":"2022-06-05T04:48:48.545782Z","iopub.status.idle":"2022-06-05T04:48:48.794952Z"},"trusted":true},"execution_count":68,"outputs":[{"name":"stderr","text":"\u001b[1mRows: \u001b[22m\u001b[34m940\u001b[39m \u001b[1mColumns: \u001b[22m\u001b[34m15\u001b[39m\n\u001b[36m──\u001b[39m \u001b[1mColumn specification\u001b[22m \u001b[36m────────────────────────────