r of participants reported in each data set.\nn_distinct(daily_activity$Id)\nn_distinct(sleep_log$Id)\nn_distinct(weight_log$Id)","metadata":{"execution":{"iopub.status.busy":"2022-06-05T04:48:46.42863Z","iopub.execute_input":"2022-06-05T04:48:46.430159Z","iopub.status.idle":"2022-06-05T04:48:46.456284Z"},"trusted":true},"execution_count":66,"outputs":[{"output_type":"display_data","data":{"text/html":"33","text/markdown":"33","text/latex":"33","text/plain":"[1] 33"},"metadata":{}},{"output_type":"display_data","data":{"text/html":"24","text/markdown":"24","text/latex":"24","text/plain":"[1] 24"},"metadata":{}},{"output_type":"display_data","data":{"text/html":"8","text/markdown":"8","text/latex":"8","text/plain":"[1] 8"},"metadata":{}}]},{"cell_type":"markdown","source":"#### **Total number of rows each dataset containing are**","metadata":{}},{"cell_type":"code","source":"#Number of rows in each data set\nnrow(daily_activity)\nnrow(sleep_log)\nnrow(weight_log)","metadata":{"execution":{"iopub.status.busy":"2022-06-05T04:48:54.469346Z","iopub.execute_input":"2022-06-05T04:48:54.471146Z","iopub.status.idle":"2022-06-05T04:48:54.499167Z"},"trusted":true},"execution_count":69,"outputs":[{"output_type":"display_data","data":{"text/html":"940","text/markdown":"940","text/latex":"940","text/plain":"[1] 940"},"metadata":{}},{"output_type":"display_data","data":{"text/html":"413","text/markdown":"413","text/latex":"413","text/plain":"[1] 413"},"metadata":{}},{"output_type":"display_data","data":{"text/html":"67","text/markdown":"67","text/latex":"67","text/plain":"[1] 67"},"metadata":{}}]},{"cell_type":"markdown","source":"### **Summary Findings:**\n\n* Daily Activity: 33 distinct \n* Sleep Log: 24 distinct  \n* Weight Log: 8 distinct","metadata":{}},{"cell_type":"markdown","source":"<a id=\"process\"></a>\n# **Process**\nIn this step we will do cleaning and manupulating of data and make it credible and accurate to use for further analysis.\n<a id=\"process-code-data\"></a>\n<a id=\"process-code-manipulating\"></a>\n### **Cleaning and Manipulating**\nWe will do cleaning and manipulating table wise(one by one) and then use them for analysis.<br/>\n#### **1)daily_activity**<br/>\n* Remove missing values.<br/>\n* Remove duplicates.<br/>\n* Rename ActivityDate column to **Date.**<br/>\n* Change Date column from character type to date type.<br/>\n* Create a new column with **Weekdays.**<br/>\n* Create a new column **TotalActiveMinutes** summing up all active minutes.<br/>","metadata":{}},{"cell_type":"code","source":"#Find duplicates\nsum(duplicated(daily_activity))\n#Find missing values\nsum(is.na(daily_activity))\n#Rename ActivityDate column to Date\ncolnames(daily_activity)[colnames(daily_activity) == \"ActivityDate\"] <- \"Date\"\n#Format column to date type\ndaily_activity$Date <-  as.Date(daily_activity$Date,format='%m/%d/%Y') \n#Add new column with weekdays\ndaily_activity$Weekdays<- wday(daily_activity$Date, label = TRUE, abbr = FALSE)\n#Add new column with total avtive minutes\ndaily_activity2 <- daily_activity %>% \n  mutate(TotalActiveMinutes = VeryActiveMinutes + FairlyActiveMinutes + LightlyActiveMinutes)\n#Verify changes made\nstr(daily_activity2)\n# I hide the output to keep the size of the notebook down, please unhide it if you want to see the output.","metadata":{"_kg_hide-output":true,"execution":{"iopub.status.busy":"2022-06-05T04:49:00.560644Z","iopub.execute_input":"2022-06-05T04:49:00.562358Z","iopub.status.idle":"2022-06-05T04:49:00.630129Z"},"trusted":true},"execution_count":70,"outputs":[{"output_type":"display_data","data":{"text/html":"0","text/markdown":"0","text/latex":"0","text/plain":"[1] 0"},"metadata":{}},{"output_type":"display_data","data":{"text/html":"0","text/markdown":"0","text/latex":"0","text/plain":"[1] 0"},"metadata":{}},{"name":"stdout","text":"tibble [940 × 17] (S3: tbl_df/tbl/data.frame)\n $ Id                      : num [1:940] 1.5e+09 1.5e+09 1.5e+09 1.5e+09 1.5e+09 ...\n $ Date             