e you ensured your data’s integrity?**<br/>\nYes, the data is consistent throughout the columns.\n\n* **What steps have you taken to ensure that your data is clean?**<br/>\nI checked duplicate values,null values and many records are valuable for analysis and remove unwanted data from the datasets. \n\n* **How can you verify that your data is clean and ready to analyze?**<br/>\nI checked null and duplicate values,rename columns according to the need of the project and change data types of the columns in a proper format.","metadata":{}},{"cell_type":"markdown","source":"# <a id=\"analyze\"></a>\n# **Analyze**","metadata":{}},{"cell_type":"markdown","source":"### **Number of records for each dataset**","metadata":{}},{"cell_type":"code","source":"recored_type <- c(\"Activity log records\",\"Sleep log records\",\"Weight log records\")\nrecord_number <-c(n_distinct(daily_activity$Id),n_distinct(sleep_log$Id), n_distinct(weight_log$Id))\nrecord_count <- data.frame(recored_type,record_number)\noptions(repr.plot.width =6, repr.plot.height =7)\nggplot(record_count, aes(recored_type,record_number)) +\n  geom_bar(stat= \"identity\", fill=\"purple\")+ \n  geom_text(aes(label=record_number), vjust=4, color=\"black\")+\n  labs(title=\"Total Records by Types\",  x= \"Record Types\", y=\"Number of Records\")+\n  theme(plot.title = element_text(size=19), text = element_text(size=15))","metadata":{"execution":{"iopub.status.busy":"2022-06-05T04:51:28.660104Z","iopub.execute_input":"2022-06-05T04:51:28.662872Z","iopub.status.idle":"2022-06-05T04:51:28.964714Z"},"trusted":true},"execution_count":88,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAAtAAAANICAIAAABhd09RAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ3wUVd/G8TNbkt1sKgkQSugISMcbaVKkd0EUFCkKIirShIcmxVtBURREBUVQ\nvBEsNAGld0FAQEGaiDSBQCjpbbNtnhcbQkgjG/awZPl9X/DZzJw9+e/skL125swZRVVVAQAA\nIJPG0wUAAADvR+AAAADSETgAAIB0BA4AACAdgQMAAEhH4AAAANIROAAAgHQEDgAAIJ0XBo7o\nv3ooBXI+ze7p2m/Tt7i/oijGkNb5fYKalvcL