 × 2</caption>\n<thead>\n\t<tr><th scope=col>Weekdays</th><th scope=col>TotalActiveMinutes</th></tr>\n\t<tr><th scope=col>&lt;ord&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>Sunday   </td><td>205.7895</td></tr>\n\t<tr><td>Monday   </td><td>226.6404</td></tr>\n\t<tr><td>Tuesday  </td><td>232.4577</td></tr>\n\t<tr><td>Wednesday</td><td>220.6857</td></tr>\n\t<tr><td>Thursday </td><td>215.8540</td></tr>\n\t<tr><td>Friday   </td><td>239.6207</td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA tibble: 6 × 2\n\n| Weekdays &lt;ord&gt; | TotalActiveMinutes &lt;dbl&gt; |\n|---|---|\n| Sunday    | 205.7895 |\n| Monday    | 226.6404 |\n| Tuesday   | 232.4577 |\n| Wednesday | 220.6857 |\n| Thursday  | 215.8540 |\n| Friday    | 239.6207 |\n\n","text/latex":"A tibble: 6 × 2\n\\begin{tabular}{ll}\n Weekdays & TotalActiveMinutes\\\\\n <ord> & <dbl>\\\\\n\\hline\n\t Sunday    & 205.7895\\\\\n\t Monday    & 226.6404\\\\\n\t Tuesday   & 232.4577\\\\\n\t Wednesday & 220.6857\\\\\n\t Thursday  & 215.8540\\\\\n\t Friday    & 239.6207\\\\\n\\end{tabular}\n","text/plain":"  Weekdays  TotalActiveMinutes\n1 Sunday    205.7895          \n2 Monday    226.6404          \n3 Tuesday   232.4577          \n4 Wednesday 220.6857          \n5 Thursday  215.8540          \n6 Friday    239.6207          "},"metadata":{}}]},{"cell_type":"markdown","source":"### **Graphical representation of different type of weekly active data(minutes) of users**\n","metadata":{}},{"cell_type":"code","source":"#average very active minutes\noptions(repr.plot.width =14, repr.plot.height =9)\nvery_active_chart <- ggplot(average_activity_minutes1, aes(x=Weekdays,y=VeryActiveMinutes, group=1))+\n  geom_line(color = \"green1\")+\n  labs(title=\"Average Very Active Minutes by Weekdays\", x= \"Weekdays\", y=\"Daily Very Active Minutes\")+\n  geom_text(aes(label=round(VeryActiveMinutes, digits=0), hjust=-0.75, vjust=0.75),size=3)+\n  theme(plot.title = element_text(size=16), text = element_text(size=12), axis.text.x = element_text(angle=35, hjust=1))\n#average fairly active minutes\nfairly_active_chart <- ggplot(average_activity_minutes1, aes(x=Weekdays, y=FairlyActiveMinutes, group=1))+\n  geom_line(color = \"blue\")+\n  labs(title=\"Average Fairly Active Minutes by Weekdays\", x= \"Weekdays\", y=\"Daily Fairly Active Minutes\")+\n  geom_text(aes(label=round(FairlyActiveMinutes, digits=0), hjust=-.75, vjust=0.75),size=3.0)+\n  theme(plot.title = element_text(size=16), text = element_text(size=12), axis.text.x = element_text(angle=35, hjust=1))\n\n#average lightly active minutes\nlightly_active_chart <- ggplot(average_activity_minutes1, aes(x=Weekdays, y=LightlyActiveMinutes, group=1))+\n  geom_line(color = \"red\")+\n  labs(title=\"Average Lightly Active Minutes by Weekdays\", x= \"Weekdays\", y=\"Daily Lightly Active Minutes\")+\n  geom_text(aes(label=round(LightlyActiveMinutes, digits=0), hjust=-0.5, vjust=0.75),size=3)+\n  theme(plot.title = element_text(size=16), text = element_text(size=12), axis.text.x = element_text(angle=35, hjust=1))\n#average total active minutes\naverage_daily_total <- ggplot(average_total_active_minutes, aes(x=Weekdays, y=TotalActiveMinutes, group=1))+\n  geom_line(color = \"orange1\")+\n  labs(title=\"Average Total Active Minutes by Weekdays\", x= \"Weekdays\", y=\"Total Active Minues\")+\n  geom_text(aes(label=round(TotalActiveMinutes, digits=0), hjust=-0.1, vjust=0.9),size=3)+\n  theme(plot.title = element_text(size=16), text = element_text(size=12), axis.text.x = element_text(angle=35, hjust=1))\n\ngrid.arrange(very_active_chart,fairly_active_chart,lightly_active_chart,average_daily_total, nrow=2)","metadata":{"execution":{"iopub.status.busy":"2022-06-05T04:52:57.845262Z","iopub.execute_input":"2022-06-05T04:52:57.846822Z","iopub.status.idle":"2022-06-05T04:52:58.594219Z"},"trusted":true},"execution_count":103,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABpAAAAQ4CAIAAACBkQg8AAAABmJLR0QA