tive users almost near to that of saturdays,and values are fluctuating between the **range(216,232)** in case of thursday-monday.<br/>","metadata":{}},{"cell_type":"markdown","source":"<a id=\"analyze-guiding\"></a>\n### **Guiding questions**\n\n* **How should you organize your data to perform analysis on it?**<br/>\nThe data has been organized into different CSVs and merged according to need to plot graphs.\n\n* **Has your data been properly formatted?**<br/>\nYes, all the columns have their correct data type.\n\n* **What surprises did you discover in the data?**<br/>\nOne of the main surprises is lack of weight data,users are not actively weighing themselves and users are most active during saturdays and taking a break during sundays and there is postive correlation between active users and good sleep and calories burnt.\n\n* **What trends or relationships did you find in the data?**<br/>\n  * There is lack of weight data(because users are using manual methods which can be tedious).\n  * Users are most active during saturdays and inactive during sundays and moderately active during monday-friday.\n  * Users are having their very active minutes during **mondays and tuesdays**.\n  * Users are actively recording their daily active records while very inactively recording their weight log records.\n  * There is postive correlation between active users and **good sleep** and **calories burnt**.\n\n\n* **How will these insights help answer your business questions?**<br/>\nThis insights helps to analyze smart devices fitness data and determine how it could help unlock new growth opportunities for Bellabeat.<br/>","metadata":{}},{"cell_type":"markdown","source":"<a id=\"analyze-key\"></a>\n### **Tasks performed are:**\n\n-  Organize and format your data.\n-  Perform calculations.\n- Identify trends and relationships.","metadata":{}},{"cell_type":"markdown","source":" <a id=\"analyze-deliverable\"></a>\n### **Deliverable**\n\n- A summary of your analysis","metadata":{}},{"cell_type":"markdown","source":"<a id=\"share\"></a>\n# **Share**\nWe have  analyzed and drawn patterns from the data by performing calculations and with the help of visualization in R.Now its time to share the analysis with the team.I have already made graphs in previous section, so in this section I will share details about the patterns drawn and conclusions.\n\n## **Trends in Fitness Tracker Usage**\n##### 1. **Participants used their fitness trackers for daily activity the most.**<br/>\nAs we have clearly seen that users have used fitness trackers the most as compare to weight tracker and sleep tracker and we have also seen that even during weekdays users are not may be that active but are moderately using fitness trackers. <br/>\n\n##### 2. **Participants are least active at the end of the work week.**<br/>\nAs we have seen from the graph that users are least active during **sundays** which can be due to most people consider sunday as rest day and users are most active during **saturdays and fridays**.<br/>\n\n##### 3. **Participants spend over half the day in sedentary activity levels.**<br/>\nThe average daily sedentary minutes for all participants was **909** minutes, or **15.15** hours,which is a lot.<br/>\n\n##### 4. **Participants with high sedentary minutes have poor sleep cycle.**<br/>\nUsers who are spending large amount of time sitting are sleeping less than need.<br/>\n \n##### 5. **There is a positive correlation between active users and good sleep and calories burnt.**<br/>\nWe can easily see from the graph that most active users are getting good sleep and burning more calories as compare to less active users.<br/>\n\n##### 6. **Positive correlation between total steps/distance and active users.**<br/>\nWe have seen that the most calories burned are when user travel large distance and with high speed,this would indicate some kind of running activity that allows the user to traverse more distance with less steps.<br/>\n\n #### **Concluding**:\n * Users may find manual data recording tedious and hence they are not recording weight data actively.<br/>\n * Users see sundays as official day break and hence taking break from being physically active.<br/> \n * Most active users are having good sleep cycle,more calories burnt.<br/>","metadata":{}},{"cell_type":"markdown","source":"<a id=\"share-guiding\"></a>\n## **Guiding questions**\n\n* **Were you able to answer the business questions?**<br/>\nYes, I analyzed the data find various patterns to answer the business questions.<br/>\n\n* **What story does your data tell?**<br/>\nThe main story the data tells is users are using various health trackers to record the data according to their schedule and also depend on how convenient the tracker is and most active users are burining more calories and having good sleep and vice versa.<br/>\n\n* **How do your findings relate to your original question?**<br/>\nThe findings are telling patterns of how users are using health trackers which is answering the original question.<br/>\n\n* **Who is your audience? What is the best way to communicate with them?**<br/>\nThe main target audience is Bellabeat marketing analytics team. The best way to communicate is through a  slide presentation of the findings.<br/>","metadata":{}},{"cell_type":"markdown","source":"<a id=\"share-key\"></a>\n### **Key tasks**\n\n- Determine the best way to share your findings.\n- Create effective data visualizations.\n- Present your findings.\n- Ensure your work is accessible.","metadata":{}},{"cell_type":"markdown","source":" <a id=\"share-deliverable\"></a>\n### **Deliverable**\n\n- [x] Supporting visualizations and key findings","metadata":{}},{"cell_type":"markdown","source":"<a id=\"act\"></a>\n# **Act**\n\nThe act phase would be done by the marketing team of the company. The main takeaway will be the top three recommendations for the marketing.","metadata":{}},{"cell_type":"markdown","source":"<a id=\"act-guiding\"></a>\n## **Guiding questions**\n\n* **What is your final conclusion based on your analysis?**<br/>\nThere is a clear relation between higher intensity activity and calories burned so logging the activity with the device could be a good motivator to increase your activity if you have some kind of plan to lose weight.The data also shows a clear trend of better quality sleep linked to the activity level that would be interesting to improve your sleep and in general to low stress and improving your quality of life.<br/>\n\n* **How could your team and business apply your insights?**<br/>\nThe insights could be implemented when preparing a marketing campaign to help to unlock new growth opportunities for Bellabeat.<br/>\n\n* **What next steps would you or your stakeholders take based on your findings?**<br/>\nFurther analysis could be done to improve health trackers features so that users can actively participate.<br/>\n\n* **Is there additional data you could use to expand on your findings?**<br/>\n   * Weight data.\n   * Large size of the data.\n   * Data related to mental health of women.","metadata":{}},{"cell_type":"markdown","source":"<a id=\"act-key\"></a>\n## **Key tasks**\n\n- [x] Create your portfolio.\n- [x] Add your case study.\n- [x] Practice presenting your case study to a friend or family member.","metadata":{}},{"cell_type":"markdown","source":"<a id=\"act-deliverable\"></a>\n## **Deliverable**\n\n ****<font size=\"4\">Recommendations:</font>****\n ### Applying Insights to Bellabeat Customers\n\n#### 1. Auto Capturing Sleep and Weight<br/>\nThe majority of users are already using fitness tracking devices to capture their daily activity such as steps and calories. Adding reminders to go to sleep or to step on the scale can encourage users to log their sleep and weight to gain further insights of their daily habits. It may be appealing to users if Bellabeat offered auto tracking for their sleep and weight to make the process easier.<br/>\n\n#### 2. Promote Regular Excersice<br/>\nThe data showed most **very active minutes** were logged on Monday and Tuesday.Keeping Bellabeat's users motivated to work out for the remainder of the week could increase these numbers. Adding short work out videos to Bellabeat's app for all fitness levels can inspire users to stay active through their work weeks.<br/>\n\n#### 3. Motivate users to move<br/>\nThe average daily sedentary minutes for all participants was **909** minutes, or **15.15** hours! Adding regular reminders throughout the **active hours** of the day can remind users to stand up and move. Consider adding a light vibration to the fitness tracker to trigger the reminder. <br/>\n\n#### 4. Sleep timer<br/>\nBellabeat can offer a feature to add daily sleep timer reminder on the app and record sleep data through it and the app can also motivate users to workout to get a good sleep through videos or notifications.As an idea: if users want to improve their sleep, the Bellabeat app can recommend reducing sedentary time.<br/>\n\n#### 5. Different criteria for users who want to lose weight<br/>\nIf users want to lose weight, it’s probably a good idea to control daily calorie consumption. Bellabeat can suggest some ideas for low-calorie lunch and dinner.<br/>","metadata":{}},{"cell_type":"markdown","source":"### Further Analysis\n\nIt's worth making note that Bellabeat's target audience are women and one of the key insights we weren't able to collect information for was reproductive health. Gathering data from Bellabeat's existing users would be highly beneficial to gain more accurate insights.<br/>\n\n\nI have tried my best to explain this analysis,please share your valuable insights so that I can improve my case study and learn along with you.","metadata":{}}]}